import React from 'react';
import './App.css';
import Nav from './Nav';
import Footer from './Footer';
import Burger from './Burger';
import Projects from './Projects';
import Header from './Header';

function HomePage(){
    return (
    <div className="App">
    <div id="body">
    <Burger />
    <Nav />
        <Header/> 

    <Projects/>
    <Footer />
    </div>
    </div>
    )
}
export default HomePage
